   331→            <h2>Contents</h2>
   332→            <ul>
   333→                <li><span class="tocnumber">1</span> <a href="#Theoretical_foundations">Theoretical foundations</a>
   334→                    <ul>
   335→                        <li><span class="tocnumber">1.1</span> <a href="#Temporal-lexical_coupling">Temporal-lexical coupling</a></li>
   336→                        <li><span class="tocnumber">1.2</span> <a href="#The_Chronosemantic_Hypothesis">The Chronosemantic Hypothesis</a></li>
